import React, { } from "react";
import { Box, Button, FormControl, Grid, Input, InputLabel, Paper, TextField, Typography } from "@mui/material";
import Base from "../components/Base";
import TableComponentCart from "../components/TableCart";

function Cart() {
  return (
    <Base title="Carrinho de Compras">
      <Paper sx={{ flexGrow: 1 }}>
        <Grid container spacing={2} mt={2}>
          <Grid item lg={12}>
            <TableComponentCart />

          </Grid>
        </Grid>
        <Grid container
          direction="row"
          justifyContent="space-between"
          alignItems="center" spacing={3}
          mt={5}>
          <Grid item>
            <Typography>Valor da compra</Typography>
            <TextField disabled value={567}  />
          </Grid>
          <Grid item>
            <Button variant="contained">salvar</Button>
          </Grid>
        </Grid>
      </Paper>
    </Base >
  );
}

export default Cart;
